catalog_script_client.script:
function onChange(control, oldValue, newValue, isLoading) {
   if (isLoading || newValue == '') {
      return;
   }

	g_form.setDisplay('service_definition', true);
	g_form.setDisplay('service_code', true);
	g_form.setReadOnly('service_definition', false);
	g_form.setMandatory('service_definition', true);

}
